window.bookSummaryJSON = "<p>AudioLearn's college level courses presents <i>Anatomy and Physiology</i>. Developed by experienced professors and professionally narrated for easy listening, this course is a great way to explore the subject of college-level anatomy and physiology. </p> <p>The audio is focused and high-yield, covering the most important topics you might expect to learn in a typical undergraduate anatomy and physiology course. </p> <p>The material is accurate, up-to-date, and broken down into bite-size chapters. There are key takeaways following each chapter to drive home key points and quizzes to review commonly tested questions. </p> <p>Here are the main topics we'll be covering: </p> <p></p> <ul> <li>Cell Anatomy and Physiology </li> <li>Body Tissues </li> <li>Integumentary System </li> <li>Skeletal System </li> <li>Muscles and the Muscular System </li> <li>Central Nervous System </li> <li>Peripheral Nervous System </li> <li>Endocrine System </li> <li>Heart Anatomy and Physiology </li> <li>Blood and Blood Vessel Anatomy and Physiology </li> <li>Lymphatic and Immune System </li> <li>Respiratory System </li> <li>Digestive System </li> <li>Metabolism and Human Nutrition </li> <li>Urinary System Fluids, Electrolytes, and the Acid-Base System </li> <li>Male Reproductive System </li> <li>Female Reproductive System </li> <li>Developmental Anatomy and Physiology </li> </ul> <p>We will conclude the course with a 200-question practice test. </p> <p>Also included is a follow-along PDF manual containing the entire text of this audio course as well as over a hundred images, figures, and illustrations we'll be discussing. </p> <p>To get the most out of this course, we recommend that you listen to the entire audio once while following along in your PDF manual, then go back and listen to areas you found challenging. </p> <p><b>PLEASE NOTE: When you purchase this title, the accompanying PDF will be available in your Audible Library along with the audio.</b> </p>"; 
